def markdownit_md_js_code():
    code = r'''
    (function () {
      var markdownit = window.markdownit;
      var hljs = window.hljs;
      var katex = window.katex;
      var markdown_it_katex_plugin = window.markdown_it_katex_plugin;

      var mdit_defaults = {
        html: false,
        xhtmlOut: false,
        breaks: false,
        langPrefix: "language-",
        linkify: true,
        typographer: true,
        _highlight: true,
        _strict: false,
      };

      mdit_defaults.highlight = function (str, lang) {
        var esc = md.utils.escapeHtml;
        if (lang && hljs.getLanguage(lang)) {
          try {
            return (
              '<pre class="hljs"><code>' +
              hljs.highlight(lang, str, true).value +
              "</code></pre>"
            );
          } catch (__) {}
        } else {
          return '<pre class="hljs"><code>' + esc(str) + "</code></pre>";
        }
      };

      var md = window.markdownit(mdit_defaults);
      md = md.use(markdown_it_katex_plugin, { engine: katex });

      window.markdownit_md = md;
    })()
    '''
    return code


